    false,nt"url": null,nt"notes": "This annual narrative report for Pocasse
    NWR outlines Refuge accomplishments during the 1967 calendar year. The report begins
    by summarizing the weather conditions, water conditions, and food and cover conditions
    during the year. Wildlife- including migratory birds and upland game birds- is also
    covered. The Refuge development and maintenance section discusses physical developments.
    Resource management is outlined; topics include fur harvesting. The public relations
    section of the report describes recreational uses and fishing. Plans for 1968 are
